import React, { useEffect, useState } from "react";
const App = () => {
  const [backendData, setBackendData] = useState([]);
  useEffect(backendData => {
    const fetchData = async () => {
      const result = await fetch("/api");
      console.log(result);
      const data = await result.json();
      console.log(data);
      setBackendData(data);
      console.log(backendData);
    };
    fetchData();
  });
  return (
    console.log(backendData.items.length),
    (
      // console.log(backendData.items.map(b => b.author_id)),
      <div>
        {backendData.length & (backendData.items > 0) ? (
          backendData.items.map(b => {
            return <div>{b.author_id}</div>;
          })
        ) : (
          <div>none</div>
        )}
        <div></div>
      </div>
    )
  );
};

export default App;
